import React from 'react';
import './App.css';

const features = [
  {
    icon: 'üòû',
    name: 'Sad-o-Meter (Depression Check)',
    tagline: 'Because crying during shampoo ads might mean something.',
    btn: 'Check Me',
  },
  {
    icon: 'üò∞',
    name: 'Anxiety Analyzer',
    tagline: 'Let‚Äôs see if that 3AM overthinking has a name.',
    btn: 'Check Me',
  },
  {
    icon: 'üí§',
    name: 'Sleep Struggle Scanner',
    tagline: 'Tired? Or just emotionally jet-lagged?',
    btn: 'Check Me',
  },
  {
    icon: 'üòµ',
    name: 'Burnout-o-Scope',
    tagline: 'Exhausted? Or corporate ghost?',
    btn: 'Check Me',
  },
  {
    icon: 'ü§î',
    name: 'Stress-O-Meter',
    tagline: 'Gauge your internal screaming levels.',
    btn: 'Check Me',
  },
  {
    icon: 'üßò',
    name: 'Zen Recommender',
    tagline: 'No, we won‚Äôt just say ‚Äútry yoga‚Äù‚Ä¶ unless it works.',
    btn: 'Try it',
  },
  {
    icon: 'ü´Ç',
    name: 'Support-o-Finder',
    tagline: 'We help you find real help, not just hug emojis.',
    btn: 'Try it',
  },
  {
    icon: 'üçï',
    name: 'Snack Therapy (Just for Fun)',
    tagline: 'Mental health tips paired with snack suggestions.',
    btn: 'Try it',
  },
];

export default function App() {
  return (
    <div className="mindcare-root">
      {/* Header Section */}
      <header className="mindcare-header">
        <div className="logo-placeholder" title="Upload your logo here" />
        <nav className="mindcare-nav">
          <a href="#mental">Mental Stuff</a>
          <a href="#tools">Cool Tools</a>
          <a href="#why">Why We Care</a>
          <a href="#login">Log In</a>
        </nav>
        <button className="talk-feelings-btn">Let‚Äôs Talk Feelings üí¨</button>
      </header>

      {/* Main Banner */}
      <section className="mindcare-banner">
        <h1>How‚Äôs your brain doing today?</h1>
        <p className="banner-subtext">Not sure if you‚Äôre burned out, bummed out, or just plain out of snacks? We got you.</p>
        <p className="banner-desc">Our features help you check-in, laugh a little, and maybe understand your mind better ‚Äî all judgment-free.</p>
      </section>

      {/* Our Features */}
      <section className="mindcare-features">
        <h2>üåü Our Features</h2>
        <div className="features-grid">
          {features.map((f, i) => (
            <div className="feature-card" key={i}>
              <div className="feature-emoji" aria-label="icon">{f.icon}</div>
              <div className="feature-title">{f.name}</div>
              <div className="feature-tagline">{f.tagline}</div>
              <button className="feature-btn">{f.btn}</button>
            </div>
          ))}
        </div>
      </section>

      {/* Floating Buttons */}
      <div className="floating-btns">
        <button className="floating-btn chat-bot" title="Talk to MindBot">
          <span role="img" aria-label="chat">üí¨</span> <span className="floating-label">Talk to MindBot ü§ñ</span>
        </button>
        <button className="floating-btn mood-memes" title="Mood Memes">
          <span role="img" aria-label="meme">üòÇ</span> <span className="floating-label">Mood Memes</span>
        </button>
      </div>
    </div>
  );
}
